import React from "react";
import { Link, useParams } from "react-router-dom";

const EventDetailPage = () => {
  const params = useParams();

  return (
    <>
      <h1>EventDetailPage</h1>
      <p>{params.eventId}</p>
      <button>
        <Link to="/events">Back to Events</Link>
      </button>
    </>
  );
};

export default EventDetailPage;
